// Typography.js
import styled, { css } from 'styled-components'
import breakpoint from 'styled-components-breakpoint'

export const H1Heading = styled.h1`
  margin-top: 0;
  margin-bottom: 0;
  font-size: 36px;
  font-weight: bold;
${breakpoint('tablet')`
  font-size: 48px;
    text-shadow: none;
  `}

  ${breakpoint('desktop')`
     font-size: 72px;
    text-shadow: none;
  `}
`

export const H2heading = styled.h2`
  margin-top: 0;
  margin-bottom: 0;
  font-size: 24px;
  font-weight: bold;



  ${breakpoint('tablet')`
    font-size: 36px;
 `}

  ${breakpoint('desktop')`
    font-size: 48px;
  `}
`
export const H3heading = styled.h3`
  margin-top: 0;
  margin-bottom: 0;
  font-size: 16px;
  font-weight: bold;



 ${breakpoint('tablet')`
    font-size: 24px;
 `}

  ${breakpoint('desktop')`
    font-size: 48px;
    font-size: 36px;
  `}
`
export const H4heading = styled.h4`

  margin-top: 0;
  margin-bottom: 0;
  font-size: 18px;
  font-weight: bold;

  ${breakpoint('tablet')`
    font-size: 20px;
  `}

  ${breakpoint('desktop')`
    font-size: 24px;
   `}
`
export const Highlight = styled.span`
  text-transform:uppercase;
  font-weight:bold;
  margin-top: 0;
  margin-bottom: 0;
  font-size: 16px;
  display:inline;
  color:#666;
 &:after{
  content:':';
  padding-right:10px;
 }



  ${breakpoint('tablet')`
    font-size: 16px;
`}

   ${breakpoint('desktop')`
    font-size: 18px;
`}

  ${props => props.dark && css`
    color:#fff;
    font-size:60% !important;
    background-color:#78BB2C;
    padding:5px 10px;
    Margin-right:10px;
    &:after{
  content:'';
  padding-right:0;

 }
  `}
`

export const Ptext = styled.p`
  margin-top: 0;
  font-size: 16px;

  ${breakpoint('tablet')`
    font-size: 18px;
`}

 ${breakpoint('desktop')`
    font-size: 21px;
  `}

  ${props => props.nopad && css`
   margin-top:-10px;
   padding:0;
   margin-left:20px;
   margin-bottom:40px;
   background-color:#efefef;
   padding:1rem;
   @media (min-width: 768px) {
    font-size: 1rem;
  }
  `}
`
